description:
Explorer Joe - The Norse Historic Society has received reports of a vast treasure of Viking relics located in the islands surrounding Greenland. Explorer Joe Thomas is commissioned to lead an expedition to explore the region. But Joe and his salty sidekick, Gadabout Swanson, get more than they bargained for when they meet...Eric The Red!

Other stories: Down The Hatch..., Explorer Joe in The Devil A Monk Would Be, and Captain Fleet in Wild Cargo.

